import {
  Typography,
  Box,
  createTheme,
  ThemeProvider,
  Container,
  Grid,
} from "@mui/material";
import Header from "../Components/Header";

const customTheme = createTheme({
  palette: {
    primary: { main: "#393646" },
    secondary: { main: "#4F4557" },
    background: { default: "#F4EEE0" },
    text: { primary: "#6D5D6E" },
  },
});

const Home = () => {
  return (
    <ThemeProvider theme={customTheme}>
      <Container disableGutters sx={{ minWidth: "100%", minHeight: "100vh" }}>
        <Grid
          container
          direction="row"
          justifyContent="center"
          alignItems="center"
        >
          <Grid item sx={{ width: "100%" }}>
            <Header />
          </Grid>
          <Grid
            container
            paddingTop="5vh"
            direction="column"
            justifyContent="center"
            width="80%"
            height="60%"
          >
            <Grid
              container
              direction="column"
              alignItems="center"
              justifyContent="center"
              sx={{
                width: "100%",
                paddingTop: "50px",
              }}
            >
              {/*sx={{ textDecoration: "underline teal" }}*/}
              <Typography color="primary">Hello</Typography>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </ThemeProvider>
  );
};

export default Home;
